import React from "react";
import logo from "./images/keep_images.png";
import "./index.css";

function Header(){
    return (
        <div className="header">
          <img src={logo} alt="keep_images" width="50" height="50"/>
          <a href="#" className="keep">Keep</a>
        </div>
    );
}
export default Header;
